import React from "react";
import covidStyle from "../../styles/content/covidStyle";

// let className = 'menu';
// if (this.props.isActive) {
//   className += ' menu-active';
// }
// return <span className={className}>Menu</span>
// const className = 'Item';

const CountryButton = ({ clickEventCountry }) => {
  //   const activeClass = "menu";
  //   if (this.props.isActive) {
  //   className += ' menu-active';
  // }

  return (
    <div style={covidStyle.divStyle}>
      <ul style={covidStyle.bListUlStyle}>
        <li style={covidStyle.bListliStyle}>
          <button
            className="menu-active btn-jp"
            style={covidStyle.buttonStyle}
            value="Japan"
            onClick={clickEventCountry}
          >
            Japan
          </button>
        </li>
        <li style={covidStyle.bListliStyle}>
          <button
            className="btn-ph"
            style={covidStyle.buttonStyle}
            value="Philippines"
            onClick={clickEventCountry}
          >
            Philippines
          </button>
        </li>
      </ul>
    </div>
  );
};

export default CountryButton;
